/***************************************************************************** 
* FUNCTION
 *  ws_get_audio_test_mode
 * DESCRIPTION
 *  To get audio test mode(AT%ACS setting value is range from 0~3)
 * PARAMETERS
 *  mode     [OUT] acs setting value will be returned in this pointer paramter
 * RETURNS
 *  TRUE : ACS audio test is ON  , FALSE: ACS audio test is OFF
 *****************************************************************************/
kal_bool ws_get_audio_test_mode(kal_uint8 *mode)
{
    *mode = acs_setting_value;

    if((acs_setting_value == 0) &&(acslb_setting_value == 0) )
    {
        return KAL_FALSE;
    }
    else
    {
        return KAL_TRUE;
    }
}

