kal_bool rmmi_is_custom_extended_cmd_character(kal_char *cmd_char)
{
    if ((*cmd_char == '%') || (*cmd_char == '$'))
    {
        return KAL_TRUE;
    }
    else if (*cmd_char == '+')
    {
        //MAUI_02235199, mtk02285, 20100208
        //exclude +CGATT from custom extended cmd table ~
        kal_uint8 i=0;
        kal_char temp_cmd_string[6];
        kal_mem_cpy(temp_cmd_string, cmd_char, 6);
        
        for (i=1; i<=5; i++)
        {
            if (RMMI_IS_LOWER(temp_cmd_string[i]))
            {
                temp_cmd_string[i] -= rmmi_char_a - RMMI_CHAR_A; //convert to UPPER case
            }
        }
        if (strncmp(&(temp_cmd_string[1]), "CGATT", 5) == 0)
        {
            return KAL_FALSE;
        }
        //~ exclude +CGATT from custom extended cmd table
        else
        {
            return KAL_TRUE;
        }
    }
    else
    {
        return KAL_FALSE;
    }
}

kal_uint16 rmmi_fast_string_print_custom(kal_uint8 * buff_ptr, kal_uint8 * fmt, void * arg_list [ ], kal_uint8 nos_arg)
{
    kal_uint8 string_length = 0;

    buff_ptr[0] = 0x02;
    string_length = rmmi_fast_string_print(buff_ptr+1, fmt, arg_list, nos_arg);
    buff_ptr[string_length+1] = 0x03;
    buff_ptr[string_length+2] = 0x00;

    return (string_length + 2);
}

kal_uint16 rmmi_custom_add_stx_etx(kal_uint8* src_str, kal_uint16 src_str_len)
{
    kal_uint16 i = 0;

    for (i=src_str_len; i>0; i--)
    {
        src_str[i] = src_str[i-1];
    }
    src_str[0] = 0x02;
    src_str[src_str_len+1] = 0x03;
    src_str[src_str_len+2] = 0x00;

    return (src_str_len + 2);
}


