/*****************************************************************************
 * FUNCTION
 *  acslb_set_AcousticLoopback
 * DESCRIPTION
 *   For at%acslb, to turn on/off acocustic loopback test with delay
 *   The delay can be customized by ACSLB_DELAY_TIME
 * PARAMETERS
 *  on_off      [IN]
 * RETURNS
 *  void
 *****************************************************************************/
void acslb_set_AcousticLoopback(kal_bool on_off)
{
#if defined(__ACOUSTIC_LOOPBACK_SUPPORT__)
    if(on_off == KAL_TRUE)
    {
        acslb_setting_value = 1;

        // to sync MED , L1AUDIO state. Besides,MED will prevent play media/mp3 tone if speech is turn on
        l4cuem_speech_set_mode_req(KAL_TRUE,RAT_2G_MODE);

        l4cuem_set_audio_mode(AUD_MODE_NORMAL);

        rmmi_set_mute(KAL_TRUE); // to prevent key tone  , call tone,etc.

        kal_sleep_task(kal_milli_secs_to_ticks(200));
		
        AcousticLoopbackLength(ACSLB_DELAY_TIME*8*1000*2); // sampling rate in speech : 8*1000 = 8K . 2 bytes/sample
        AcousticLoopbackOn();
    }
    else
    {
        acslb_setting_value = 0;

        // to sync MED , L1AUDIO state. Turn off speech after audio test
        l4cuem_speech_set_mode_req(KAL_FALSE,RAT_2G_MODE);

        l4cuem_set_audio_mode(AUD_MODE_NORMAL);

        rmmi_set_mute(KAL_FALSE);

        kal_sleep_task(kal_milli_secs_to_ticks(200));
        AcousticLoopbackOff();
    }
#endif	
}


/*****************************************************************************
 * FUNCTION
 *  acslb_timer_expiry_hdlr
 * DESCRIPTION
 *   For at%acslb, afetr turn on AcousticLoopback, we turn off AcousticLoopback after a period of time
 *   This is the timer expiry handler function for acslb timer
 * PARAMETERS
 *  void
 * RETURNS
 *  void
 *****************************************************************************/
void acslb_timer_expiry_hdlr(void)
{
#if defined(__ACOUSTIC_LOOPBACK_SUPPORT__)
    acslb_set_AcousticLoopback(KAL_FALSE);

    return;
#endif
}


