/*****************************************************************************
 * FUNCTION
 *  rmmi_bndi_hdlr
 * DESCRIPTION
 *  
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
extern void rmmi_custom_bndi_read_rrsp(kal_bool result, kal_uint8 *data);
void rmmi_bndi_hdlr(rmmi_string_struct *source_string_ptr)
{
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN*2];

    rmmi_custom_dbg_trace_int("rmmi_bndi_hdlr entry, cmd_mode=%d", source_string_ptr->cmd_mode);
    switch (source_string_ptr->cmd_mode)
    {
        case RMMI_TEST_MODE:
        {
            kal_uint8 percent_char = '%';
            kal_uint8 stx = 0x02;
            kal_uint8 etx = 0x03;			
            RMMI_PTR->arg_list[0] = (void*)&stx;
            RMMI_PTR->arg_list[1] = (void*)&percent_char;
            RMMI_PTR->arg_list[2] = (void*)&etx;
            string_length = rmmi_fast_string_print(buffer, 
                                                   (kal_uint8*) "%cAT%cBNDI=[BAND : 3, 4, 6, 8]%c\r\n[3] : PCS\r\n[4] : DCS\r\n[6] : DUAL EXT\r\n[8] : DUAL US", 
                                                   RMMI_PTR->arg_list, 
                                                   3);
            rsp_str = &buffer[0];
            ret_val = KAL_TRUE;
            break;
        }
        case RMMI_ACTIVE_MODE:
        case RMMI_READ_MODE:
        {
            kal_uint8 gsm_band = 0;
            kal_uint8 umts_fdd_band = 0;
            kal_bool result = KAL_FALSE;
            //read from NVRAM
            //l4c_eq_read_prefer_band_req_bndi(source_string_ptr->src_id);
            result = l4c_nw_get_band_req(source_string_ptr->src_id, &gsm_band, &umts_fdd_band);
            rmmi_custom_dbg_trace_int("l4c_nw_get_band_req, result=%d", result);
            rmmi_custom_dbg_trace_int("l4c_nw_get_band_req, gsm_band=%d", gsm_band);
            rmmi_custom_bndi_read_rrsp(result, &gsm_band);
            return;
        }

        case RMMI_SET_OR_EXECUTE_MODE:
        {
            kal_uint8 opcode = (kal_uint8) rmmi_int_validator(source_string_ptr, (kal_uint8) RMMI_COMMA);

            if (opcode == RMMI_VALIDATOR_ERROR)
            {
                break; //invalid format
            }
            else
            {
                kal_uint8 band=0;
                kal_uint8 band_umts[2] = {0,0};
                if (opcode == 3)
                {
                    band = (kal_uint8)(0x10); //PCS
                }
                else if (opcode == 4)
                {
                    band = (kal_uint8)(0x08); //DCS
                }
                else if (opcode == 6)
                {
                    band = (kal_uint8)(0x02 | 0x08); //DUAL EXT
                }
                else if (opcode == 8)
                {
                    band = (kal_uint8)(0x80 | 0x10); //DUAL US
                }				
                else
                {
                    break;
                }

                #ifndef __EGSM900__
                if (band & 0x02)    //Band900 is not support
                {
                    break;
                }
                #endif 

                #ifndef __DCS1800__
                if (band & 0x08)    //Band1800 is not support
                {
                    break;
                }
                #endif

                #ifndef __PCS1900__
                if (band & 0x10)    //Band1900 is not support
                {
                    break;
                }
                #endif

                #ifndef __GSM850__
                if (band & 0x80)    //Band850 is not support
                {
                    break;
                }
                #endif 
			
                // ask RAC to select and set the band.
                ret_val = l4c_nw_set_preferred_band_req(source_string_ptr->src_id, KAL_TRUE, band, KAL_FALSE, band_umts);
                if (ret_val == KAL_TRUE)
                {
                    string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "BNDI OK", RMMI_PTR->arg_list, 0);
                    // the final "OK" will be print out after band selection succeed.
                    rsp_str = &buffer[0];				
                    rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);
                    return;
                }
                else
                {
                    string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "BNDI ERROR", RMMI_PTR->arg_list, 0);
                }
            }
            break;
        }
        default:
        {
            /* unrecognized format of AT command line */
            break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;
}


