/*****************************************************************************
 * FUNCTION
 *  rmmi_nosleep_hdlr
 * DESCRIPTION
 *  
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_nosleep_hdlr(rmmi_string_struct *source_string_ptr)
{
    static kal_bool set_to_sleep_mode = KAL_TRUE;
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];

    rmmi_custom_dbg_trace_int("rmmi_nosleep_hdlr entry, cmd_mode=%d", source_string_ptr->cmd_mode);
    switch (source_string_ptr->cmd_mode)
    {
        case RMMI_TEST_MODE:
        case RMMI_ACTIVE_MODE:
        case RMMI_READ_MODE:
        {
            if (set_to_sleep_mode == KAL_TRUE)
            {
                string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "0", RMMI_PTR->arg_list, 0);
            }
            else
            {
                string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "1", RMMI_PTR->arg_list, 0);
            }				
            rsp_str = &buffer[0];
            rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);				
            return;
            //break;
        }
        
        case RMMI_SET_OR_EXECUTE_MODE:
        {
            /* Get the seed from the command line and validate it */
            kal_uint8 op = (kal_uint8) rmmi_int_validator(
                                source_string_ptr,
                                RMMI_PTR->s_reg.s3 /* separator */ );
            if (op > 1)
            {
                string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "NOSLEEP ERROR", RMMI_PTR->arg_list, 0);
                rsp_str = &buffer[0];
                rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);				
                return;
            }
        #ifndef WIN32
            if (op == 0)
            {
                rmmi_custom_dbg_trace("call L1SM_SleepEnable() now");
                L1SM_SleepEnable(rmmi_aux_PDNhandle);
                set_to_sleep_mode = KAL_TRUE;
                string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "[0]Sleep Mode", RMMI_PTR->arg_list, 0);
                rsp_str = &buffer[0];
                rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);				
                return;
            }
            else if (op == 1)
            {
                rmmi_custom_dbg_trace("call L1SM_SleepDisable() now");
                L1SM_SleepDisable(rmmi_aux_PDNhandle);  //doesn't allow system to sleep
                set_to_sleep_mode = KAL_FALSE;
                string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "[1]No Sleep Mode", RMMI_PTR->arg_list, 0);
                rsp_str = &buffer[0];
            }
        #endif /* WIN32 */
            ret_val = KAL_TRUE;
            break;
        }
        default:
        {
            /* unrecognized format of AT command line */
            break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;
}


/*****************************************************************************
 * FUNCTION
 *  rmmi_sync_hdlr
 * DESCRIPTION
 *  
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_sync_hdlr(rmmi_string_struct *source_string_ptr)
{
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[512];

    rmmi_custom_dbg_trace_int("rmmi_sync_hdlr entry, cmd_mode=%d", source_string_ptr->cmd_mode);
    switch (source_string_ptr->cmd_mode)
    {
        case RMMI_TEST_MODE:
		{
			kal_uint8 i = 0;
			kal_uint16 tmp_str_len = 0;
			kal_uint8* write_ptr = buffer;
			kal_uint8 tmp_str_table[][32] = 
			{
			    "ATxSYNC=[BaudRate:0~10]",
			    "[0] BaudRate 300",
			    "[1] BaudRate 1200",
			    "[2] BaudRate 2400",
			    "[3] BaudRate 4800",
			    "[4] BaudRate 9600",
			    "[5] BaudRate 14400",
			    "[6] BaudRate 19200",
			    "[7] BaudRate 28800",
			    "[8] BaudRate 38400",			
			    "[9] BaudRate 57600",
			    "[10] BaudRate 115200"
			};
			tmp_str_table[0][2] = '%';

            for (i=0; i<=11; i++)
            {
                tmp_str_len = rmmi_fast_string_print_custom(write_ptr, &(tmp_str_table[i][0]), RMMI_PTR->arg_list, 0);    		
	    		write_ptr += tmp_str_len;
				*write_ptr = 0x0D;
				*(write_ptr+1) = 0x0A;
				write_ptr += 2;
            }
			*write_ptr = 0x00; //end of string
			rsp_str = &buffer[0];
			string_length = strlen((const char *)rsp_str);
			ret_val = KAL_TRUE;
			break;
		}
		case RMMI_ACTIVE_MODE:
		case RMMI_READ_MODE:
        {
            string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "TARGET CONNECTED OK!!", RMMI_PTR->arg_list, 0);
            rsp_str = &buffer[0];
            ret_val = KAL_TRUE;			
            break;
        }        
        case RMMI_SET_OR_EXECUTE_MODE:
        {
            kal_uint8 opcode = (kal_uint8) rmmi_int_validator(source_string_ptr, (kal_uint8) RMMI_COMMA);

            if (opcode == RMMI_VALIDATOR_ERROR)
            {
                break; //invalid format
            }
            else
            {
                kal_uint8 uart_port_num = 99;
				uart_port_num = rmmi_cid_2_port(
					rmmi_srcid_2_cid(source_string_ptr->src_id));
				rmmi_custom_dbg_trace_int("uart_port_num=%d", uart_port_num);
                if ((opcode <=10) /* && (opcode >=0)*/)
                {
                    kal_uint32 rate = 0;
					if (opcode == 0)
						rate = 300;
					else if (opcode == 1)
						rate = 1200;
					else if (opcode == 2)
						rate = 2400;
					else if (opcode == 3)
						rate = 4800;
					else if (opcode == 4)
						rate = 9600;
					else if (opcode == 5)
						rate = 14400;
					else if (opcode == 6)
						rate = 19200;
					else if (opcode == 7)
						rate = 28800;
					else if (opcode == 8)
						rate = 38400;
					else if (opcode == 9)
						rate = 57600;
					else if (opcode == 10)
						rate = 115200;
		            {
		                UART_CONFIG_T dcb;
		                RMMI_UART_ReadDCBConfig(uart_port_num, &dcb, rmmi_current_mod_id);
		                dcb.u4Baud = rate;
						rmmi_custom_dbg_trace_int("call UART_SetDCBConfig(), rate=%d", rate);
		                RMMI_UART_SetDCBConfig(uart_port_num, &dcb, rmmi_current_mod_id);
		            }
		        #ifdef __CSD_FAX__
		            if (rate == 0)
		            {
		                rmmi_custom_dbg_trace("call UART_SetAutoBaud_Div(), rate=%d");
		                RMMI_UART_SetAutoBaud_Div(uart_port_num, rmmi_current_mod_id);
		            }
		        #endif /* __CSD_FAX__ */             
                    return;
               	}
				else
				{
					break;
				}	
           	}
			break;
        }
        default:
        {
            /* unrecognized format of AT command line */
            break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;

}
 
