/*****************************************************************************
 * FUNCTION
 *  rmmi_batl_hdlr
 * DESCRIPTION
 *  return the supplied voltage of battery
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_batl_hdlr(rmmi_string_struct *source_string_ptr)
 {
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];
    uem_bmt_struct bmt_status;
    kal_uint32 volt1;
    kal_uint32 volt2;

    switch (source_string_ptr->cmd_mode)
    {
    	 case RMMI_SET_OR_EXECUTE_MODE:  //AT%BATL=
    	 {            
	     kal_uint8 error_cause;
            kal_uint8 value;
	
	     value = (kal_uint8) rmmi_int_validator_ext(&error_cause, source_string_ptr, RMMI_PTR->s_reg.s3);

	     //if there is character next to = , return ERROR
            if (value == RMMI_VALIDATOR_ERROR && error_cause == RMMI_PARSE_NOT_FOUND)
            {
			{
				kal_uint8 adc_channel;
				//bmt_customized_struct  *charing_para;
				kal_uint16 adc;
				kal_int32 volt;
				DCL_HANDLE dcl_handle;
				ADC_CTRL_GET_PHYSICAL_CHANNEL_T adc_ch;

				dcl_handle = DclSADC_Open(DCL_ADC, FLAGS_NONE);
				adc_ch.u2AdcName = DCL_VBAT_ADC_CHANNEL;
				DclSADC_Control(dcl_handle, ADC_CMD_GET_CHANNEL, (DCL_CTRL_DATA_T *) &adc_ch);
				DclSADC_Close(dcl_handle);

				adc_channel = adc_ch.u1AdcPhyCh;

				//charing_para=bmt_get_customized_chr_para();

				adc = ADC_GetData(adc_channel);
				volt = (kal_int32)adc_adc2vol(adc_channel, (double)adc);
				volt1 = volt/1000000;
				volt2 = (volt / 100000)%10;

				RMMI_PTR->arg_list[0] = (void*)&volt1;            	   
				RMMI_PTR->arg_list[1] = (void*)&volt2;
			}

		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "%d.%d",
                                RMMI_PTR->arg_list,
                                2);
            	   rsp_str = &buffer[0];
	           ret_val = KAL_TRUE;

            	   break;
            }
	     else
	     {
                 break;
            }
    	 }
        case RMMI_TEST_MODE: //AT%BATL=?
        case RMMI_READ_MODE:  //AT%BATL?
        case RMMI_ACTIVE_MODE: //AT%BATL
	{
		{
			kal_uint8 adc_channel;
			//bmt_customized_struct  *charing_para;
			kal_uint16 adc;
			kal_int32 volt;
			DCL_HANDLE dcl_handle;
			ADC_CTRL_GET_PHYSICAL_CHANNEL_T adc_ch;
			
			dcl_handle = DclSADC_Open(DCL_ADC, FLAGS_NONE);
			adc_ch.u2AdcName = DCL_VBAT_ADC_CHANNEL;
			DclSADC_Control(dcl_handle, ADC_CMD_GET_CHANNEL, (DCL_CTRL_DATA_T *) &adc_ch);
			DclSADC_Close(dcl_handle);
			
			adc_channel = adc_ch.u1AdcPhyCh;

			//charing_para=bmt_get_customized_chr_para();

			adc = ADC_GetData(adc_channel);
			volt = (kal_int32)adc_adc2vol(adc_channel, (double)adc);
			volt1 = volt/1000000;
			volt2 = (volt / 100000)%10;
		
             RMMI_PTR->arg_list[0] = (void*)&volt1;            	   
	     RMMI_PTR->arg_list[1] = (void*)&volt2;	 
		}
	     string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "%d.%d",
                                RMMI_PTR->arg_list,
                                2);
             rsp_str = &buffer[0];
	     ret_val = KAL_TRUE;

            break;
        }
        default:
        {
            /* unrecognized format of AT command line */
            break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;

}

