/*****************************************************************************
 * FUNCTION
 *  rmmi_vlc_hdlr
 * DESCRIPTION
 *  Control all volumes of user currenly hearing from handset 
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_vlc_hdlr(rmmi_string_struct *source_string_ptr)
 {
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 level;
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];
	
    switch (source_string_ptr->cmd_mode)
    {
        case RMMI_SET_OR_EXECUTE_MODE:  //AT%VLC=
    	 {
	    kal_uint8 error_cause;

            level = (kal_uint8) rmmi_int_validator_range_check(
                                &error_cause,
                                source_string_ptr,
                                RMMI_PTR->s_reg.s3,
                                3);

            if (level == RMMI_VALIDATOR_ERROR)
            {
            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "VLC ERROR",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];
			rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);
            		break;
            }
            if (level == 0)
            {       
			media_aud_set_volume(AUD_VOLUME_CTN, 0);  
			media_aud_set_volume(AUD_VOLUME_KEY, 0);  	
			media_aud_set_volume(AUD_VOLUME_MIC, 0x40|0);  
			media_aud_set_volume(AUD_VOLUME_FMR, 0);  
			media_aud_set_volume(AUD_VOLUME_SPH, 0);  
			media_aud_set_volume(AUD_VOLUME_SID, 0);  			
			media_aud_set_volume(AUD_VOLUME_MEDIA, 0x40|0);  

            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "[0]VOLUME",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];
	     		ret_val = KAL_TRUE;
            		break;
            }
	     else if (level == 1)
            {
			media_aud_set_volume(AUD_VOLUME_CTN, 1);  
			media_aud_set_volume(AUD_VOLUME_KEY, 1);  
			media_aud_set_volume(AUD_VOLUME_MIC, 1);  
			media_aud_set_volume(AUD_VOLUME_FMR, 1);  
			media_aud_set_volume(AUD_VOLUME_SPH, 1);  
			media_aud_set_volume(AUD_VOLUME_SID, 1);  
			media_aud_set_volume(AUD_VOLUME_MEDIA, 1);  

            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "[1]VOLUME",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];    
	     		ret_val = KAL_TRUE;
            		break;
            }
	     else if (level == 2)
            {
			media_aud_set_volume(AUD_VOLUME_CTN, 3);  
			media_aud_set_volume(AUD_VOLUME_KEY, 3);  
			media_aud_set_volume(AUD_VOLUME_MIC, 3);  
			media_aud_set_volume(AUD_VOLUME_FMR, 3);  
			media_aud_set_volume(AUD_VOLUME_SPH, 3);  
			media_aud_set_volume(AUD_VOLUME_SID, 3);  
			media_aud_set_volume(AUD_VOLUME_MEDIA, 3);  

            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "[2]VOLUME",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];     
	     		ret_val = KAL_TRUE;
            		break;
            }
	     else if (level == 3)
            {
			media_aud_set_volume(AUD_VOLUME_CTN, 6);  
			media_aud_set_volume(AUD_VOLUME_KEY, 6);  
			media_aud_set_volume(AUD_VOLUME_MIC, 6);  
			media_aud_set_volume(AUD_VOLUME_FMR, 6);  
			media_aud_set_volume(AUD_VOLUME_SPH, 6);  
			media_aud_set_volume(AUD_VOLUME_SID, 6);  
			media_aud_set_volume(AUD_VOLUME_MEDIA, 6);  

            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "[3]VOLUME",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];    
	     		ret_val = KAL_TRUE;
            		break;
            }
        }
	 case RMMI_ACTIVE_MODE: //AT%VLC
        case RMMI_READ_MODE:  //AT%VLC?
        case RMMI_TEST_MODE: //AT%VLC=?
        {
	    kal_uint8 volume_cnt, volume_key, volume_mic, volume_fmr, volume_sph, volume_sid, volume_media;

	    media_aud_get_volume(AUD_VOLUME_CTN, &volume_cnt);     
	    media_aud_get_volume(AUD_VOLUME_KEY, &volume_key);     
	    media_aud_get_volume(AUD_VOLUME_MIC, &volume_mic);     
	    media_aud_get_volume(AUD_VOLUME_FMR, &volume_fmr);     
	    media_aud_get_volume(AUD_VOLUME_SPH, &volume_sph);     
	    media_aud_get_volume(AUD_VOLUME_SID, &volume_sid);     
	    media_aud_get_volume(AUD_VOLUME_MEDIA, &volume_media);     

	    volume_mic = volume_mic & (~0x40);
	    volume_media = volume_media & (~0x40);
		
	    if ((volume_cnt == volume_key) && (volume_key == volume_mic) && 
		  (volume_mic == volume_fmr) && (volume_fmr == volume_sph) &&
		  (volume_sph == volume_sid) && (volume_sid == volume_media) )	  
	    {
		   if (volume_cnt == 0)
		   {
			
		   }
		   else if (volume_cnt >= 1 && volume_cnt <= 2)
		   {
			volume_cnt = 1;
		   }
		   else if (volume_cnt >= 3 && volume_cnt <= 4)
		   {
			volume_cnt = 2;
		   }
		   else if (volume_cnt >= 5 && volume_cnt <= 6)
		   {
			volume_cnt = 3;
		   }
		   
            	   RMMI_PTR->arg_list[0] = (void*)&volume_cnt;     
		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "%d",
                                RMMI_PTR->arg_list,
                                1);
            	   rsp_str = &buffer[0];
	    }
	    else
	    {
		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "2",
                                RMMI_PTR->arg_list,
                                0);
            	   rsp_str = &buffer[0];
	    }

	    ret_val = KAL_TRUE;
	    break;       
	 }
        default:
        {
            /* unrecognized format of AT command line */
            break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;

}

