/*****************************************************************************
 * FUNCTION
 *  rmmi_writewm_hdlr
 * DESCRIPTION
 *  write a register of Wolfson and return it's actual result
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_writewm_hdlr(rmmi_string_struct *source_string_ptr)
{
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint32 opcode1, opcode2 = 0x00;
    kal_uint16 old_value, readback_value = 0x00;
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];
	
    switch (source_string_ptr->cmd_mode)
    {
      case RMMI_SET_OR_EXECUTE_MODE:  
      {
        kal_uint8 result;
        kal_uint8 str1[3], str2[5];   //"0000"-"ffff"
	        kal_uint8 hexBuffer[RMMI_SHORT_RSP_LEN];		
        kal_uint8 error_cause = RMMI_PARSE_OK;

        result = rmmi_hex_validator_ext(
                    (kal_uint8*) & error_cause,
                    source_string_ptr,
                    RMMI_COMMA, /* separator */
                    3,
                    (kal_uint8*) str1);

        if (result == RMMI_VALIDATOR_ERROR)
        {
            break;
        }

        if(rmmi_hexstring_to_integer(str1, &opcode1) == KAL_FALSE)
         break;

        result = rmmi_hex_validator_ext(
                    (kal_uint8*) & error_cause,
                    source_string_ptr,
                    RMMI_PTR->s_reg.s3, /* separator */
                    5,
                    (kal_uint8*) str2);

        if (result == RMMI_VALIDATOR_ERROR)
        {
            break;
        }

        if(rmmi_hexstring_to_integer(str2, &opcode2) == KAL_FALSE)
         break;

        AT_WriteWM9090Reg((kal_uint16)opcode1, (kal_uint16)opcode2, 1, &old_value, &readback_value);
          		
			     kal_sprintf(hexBuffer, "0x%x, 0x%04x", opcode1, readback_value);	
			     RMMI_PTR->arg_list[0] = (void*)hexBuffer;
  
	       string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "%s", RMMI_PTR->arg_list, 1);
        rsp_str = &buffer[0];
        ret_val = KAL_TRUE;
        
       break;
      }
		
      default:
      {
          /* unrecognized format of AT command line */
          break;
      }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;

}



