/*****************************************************************************
 * FUNCTION
 *  rmmi_spm_hdlr
 * DESCRIPTION
 *  Activate / deactivate speaker phone mode
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_spm_hdlr(rmmi_string_struct *source_string_ptr)
 {
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];

    switch (source_string_ptr->cmd_mode)
    {
    	 case RMMI_SET_OR_EXECUTE_MODE:  //AT%SPM=
    	 {            
	     kal_uint8 error_cause;
            kal_uint8 value;
	
            value = (kal_uint8) rmmi_int_validator_range_check(
                                &error_cause,
                                source_string_ptr,
                                RMMI_PTR->s_reg.s3,
                                1);

	     if (value == RMMI_VALIDATOR_ERROR)
            {
            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "SPM ERROR",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];
			rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);
            		return;
            }
					 
            if (value == 1)
            {				 
            	   l4c_eq_set_hand_free_mode_req_lind(KAL_TRUE);

		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "SPM ON",
                                RMMI_PTR->arg_list,
                                0);
            }
	     else
	     {
            	   l4c_eq_set_hand_free_mode_req_lind(KAL_FALSE);
				 
		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "SPM OFF",
                                RMMI_PTR->arg_list,
                                0);
            }

	     rsp_str = &buffer[0];
	     ret_val = KAL_TRUE;
            break;
    	 }
        case RMMI_TEST_MODE: //AT%SPM=?
        case RMMI_READ_MODE:  //AT%SPM?
        case RMMI_ACTIVE_MODE: //AT%SPM
        {
            l4c_eq_query_hand_free_mode_req_lind();
            L4C_PTR->route_thru_lmmi = KAL_TRUE;
            L4C_PTR->route_thru_lmmi_user = source_string_ptr->src_id;			
            return;
        }
        default:
        {
            /* unrecognized format of AT command line */
            break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;

}

