/*****************************************************************************
 * FUNCTION
 *  rmmi_mpt_hdlr
 * DESCRIPTION
 *  
 * PARAMETERS
 *  source_string_ptr       [IN]        At cmd string
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_mpt_hdlr(rmmi_string_struct *source_string_ptr)
 {
    kal_bool ret_val = KAL_FALSE;
    kal_uint8 const *rsp_str = NULL;    /* response string and initialization */
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];

    switch (source_string_ptr->cmd_mode)
    {
    	 case RMMI_SET_OR_EXECUTE_MODE:  //AT%MPT=
    	 {            
	     kal_uint8 error_cause;
            kal_uint8 value;
	
            value = (kal_uint8) rmmi_int_validator_range_check(
                                &error_cause,
                                source_string_ptr,
                                RMMI_PTR->s_reg.s3,
                                5);

	     if (value == RMMI_VALIDATOR_ERROR ||value == 1 ||value == 2 ||value == 5)
            {
            	       string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "MP3 ERROR",
                                RMMI_PTR->arg_list,
                                0);
                     rsp_str = &buffer[0];
			rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);
            		return;
            }

            if (value == 0)
            {
                 RMMI_PTR->mpt_flag = 0;
				 
                 l4c_eq_audio_stop_by_string_req(source_string_ptr->src_id);
	
		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "MP3 OFF",
                                RMMI_PTR->arg_list,
                                0);
            }
	     else if (value == 3)
	     {
                 RMMI_PTR->mpt_flag = 3;
				 
		   l4c_eq_audio_play_by_string_req(source_string_ptr->src_id,
		   	                                                     midifile1, 
		   	                                                     84890,
		   	                                                     MED_TYPE_DAF,
		   	                                                     DEVICE_AUDIO_PLAY_INFINITE,
		   	                                                     0,
		   	                                                     0,
		   	                                                     0,
		   	                                                     3,
		   	                                                     AUDIO_DEVICE_LOUDSPEAKER,
		   	                                                     KAL_TRUE);

		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "L",
                                RMMI_PTR->arg_list,
                                0);
            }
	     else if (value == 4)
	     {
                 RMMI_PTR->mpt_flag = 4;
				 
		   l4c_eq_audio_play_by_string_req(source_string_ptr->src_id,
		   	                                                     midifile2, 
		   	                                                     84890,
		   	                                                     MED_TYPE_DAF,
		   	                                                     DEVICE_AUDIO_PLAY_INFINITE,
		   	                                                     0,
		   	                                                     0,
		   	                                                     0,
		   	                                                     3,
		   	                                                     AUDIO_DEVICE_LOUDSPEAKER,
		   	                                                     KAL_TRUE);
		   
		   string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "R",
                                RMMI_PTR->arg_list,
                                0);
            }

	     rsp_str = &buffer[0];
	     rmmi_write_to_uart((kal_uint8*) rsp_str, string_length, KAL_TRUE);
            return;
    	 }
        case RMMI_TEST_MODE: //AT%MPT=?
        case RMMI_READ_MODE:  //AT%MPT?
        case RMMI_ACTIVE_MODE: //AT%MPT
	 {
           RMMI_PTR->arg_list[0] = (void*)&RMMI_PTR->mpt_flag;        
	    string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "%d",
                                RMMI_PTR->arg_list,
                                1);
            rsp_str = &buffer[0];
            ret_val = KAL_TRUE;
            break;
        }
        default:
        {
            	/* unrecognized format of AT command line */
            	break;
        }
    }   /* end of the switch */

    rmmi_final_rsp_generator(source_string_ptr->src_id, ret_val, (kal_uint8*) rsp_str, string_length);
    return;

}

