/*****************************************************************************
 * FUNCTION
 *  rmmi_ecall_result_rrsp
 * DESCRIPTION
 *  To output response for AT%ECALL
 *  <STX>[1]ECALL ON<ETX>
 *  <STX>[0]ECALL OFF<ETX>
 *  <STX>ECALL ERROR<ETX> 
 * PARAMETERS
 *  
 * RETURNS
 *  void
 *****************************************************************************/
 void rmmi_ecall_result_rrsp(kal_uint8 src_id,kal_bool result)
{
    kal_uint16 string_length = 0;       /* string length variable */
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];

    kal_mem_set(buffer,0,sizeof(buffer));

    RMMI_PTR->current_src = src_id;
	
    if(result == KAL_TRUE)
    {
        if(ecall_action == 1)
        {
            string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "[1]ECALL ON",
                                RMMI_PTR->arg_list,
                                0);        
        }
        else 
        {			
            string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "[0]ECALL OFF",
                                RMMI_PTR->arg_list,
                                0);                
        }	

        rmmi_write_to_uart((kal_uint8*) buffer, string_length, KAL_TRUE);
        rmmi_result_code_fmttr(RMMI_RCODE_OK, 0);				
    }
    else 
    {
        string_length = rmmi_fast_string_print_custom(
                                buffer,
                                (kal_uint8*) "ECALL ERROR",
                                RMMI_PTR->arg_list,
                                0);            

        rmmi_write_to_uart((kal_uint8*) buffer, string_length, KAL_TRUE);
        rmmi_result_code_fmttr(RMMI_RCODE_ERROR, 0);		
    }

    ecall_action = 0xff; //reset ecall action flag

    return;	
}


