/*****************************************************************************
 * FUNCTION
 *  rmmi_custom_bndi_read_rrsp
 * DESCRIPTION
 *  
 * PARAMETERS
 *  result      [IN]        
 *  length      [IN]        
 *  data        [?]         
 * RETURNS
 *  void
 *****************************************************************************/
void rmmi_custom_bndi_read_rrsp(kal_bool result, kal_uint8 *data)
{
    kal_uint16 string_length = 0;
    kal_uint8 buffer[RMMI_SHORT_RSP_LEN];
	kal_bool ret_val = KAL_FALSE;

    ASSERT(data != NULL); //check if null pointer
    rmmi_custom_dbg_trace("rmmi_custom_bndi_read_rrsp entry");
    if (result == KAL_FALSE)
    {
        //cannot return current band info
        //goto the bottom of the function to output "OK"
        string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "", RMMI_PTR->arg_list, 0);
    }
    else
    {
        rmmi_custom_dbg_trace_int("data[0]=%d", *data);
        ret_val = KAL_TRUE;
        if (*data == 0x10)
        {
            string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "PCS", RMMI_PTR->arg_list, 0); //PCS
        }
		else if (*data == 0x08)
		{
		    string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "DCS", RMMI_PTR->arg_list, 0); //DCS
		}
		else if (*data == (0x02 | 0x08))
		{
		    string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "DUAL EXT", RMMI_PTR->arg_list, 0); //DUAL EXT
		}
		else if (*data == (0x80 | 0x10))
		{
		    string_length = rmmi_fast_string_print_custom(buffer, (kal_uint8*) "DUAL US", RMMI_PTR->arg_list, 0); //DUAL US
		}				
		else
		{
		    string_length = 0;
		}   	
    }    
	rmmi_final_rsp_generator(RMMI_PTR->current_src, ret_val, (kal_uint8*) buffer, string_length);
}

